  donnerUnAvis(collegue: Collegue, avis: Avis): Observable<Collegue> {
    if (avis === Avis.AIMER) {
      collegue.score += 1
    }
    else {
      collegue.score -= 1
    }
    let collegue2 = { ...collegue }
    let aVote = { collegue: collegue2, avis }
    this.subject.next(aVote);
    return of(collegue2);
  }


